script: |
  super -f text -I q10673.spq | sort > q10673.out

inputs:
  - name: q10673.spq
    data: |
      SELECT + col2 * col2 AS col1 FROM tab0 (FORMAT parquet) WHERE - col0 NOT BETWEEN NULL AND + 44 * + - ( 37 ) - + col1 + - + col0;
  - name: tab0

outputs:
  - name: q10673.out
    data: |
      100
      2209
      9801
